import React from "react";
import "./style.css";

function Contact() {
  return (
    <div className="container">
      <div className="row">
        <div className="col s12 center">
          <h6>Contact me at Github, LinkedIn, or Gmail</h6>
          links listed above
          <h6>
            <a
              rel="noopener noreferrer"
              target="_blank"
              href="https://drive.google.com/file/d/1R2u1wuaLrwt9LVKeUYdi4cYio9dRVuyP/view?usp=sharing"
            >
              View my resume
            </a>
          </h6>
        </div>
      </div>
    </div>
  );
}

export default Contact;
